window.bookSummaryJSON = "<p>Alyssa Gardner went down the rabbit hole and took control of her destiny. She survived the battle for Wonderland and the battle for her heart. In this collection of three novellas, join Alyssa and her family as they look back at their memories of Wonderland. </p> <p>In <i>Six Impossible Things</i>, Alyssa recalls the most precious moments of her life after <i>Ensnared</i> and the role magic plays in preserving the happiness of those she loves. In <i>The Boy in the Web</i>, Alyssa's mother reminisces about her own time in Wonderland and giving up the crown to rescue the man who would become her husband. And in <i>The Moth in the Mirror</i>, Morpheus delves into Jeb's memories of the events of <i>Splintered</i>. </p>"; 
